const initialState ={
  dataProducts: [],
  load: true,
}
const getProducts = (state = initialState, action) => {
  switch (action.type) {
    case "GET_PRODUCTS":
      return {
        dataProducts: []
      }

    default:
      return state;
  }
};
export default getProducts;
